import { Link } from 'react-router-dom';

function ServiceCategory({ link, category }) {
    return (
        <>
            <li>
                <Link  style={`backgroundColor:'#001247 !important'`} to={link}>{category}</Link>
            </li>
        </>
    );
}

export default ServiceCategory;
